import "bootstrap/dist/css/bootstrap.min.css"; 
function App() {
  return (
  <div className="container text-center">
    <div className="row">

      <div className="col">
      Bienvenido al sistema de recomendación
      </div>

      <div>
      <button className="col btn btn-primary">
        Una chimba e botón
      </button>
      </div>

    </div>
  </div>
  );
}

export default App;
